import React, { useState } from 'react';

const PlansList = ({ plans, onDeletePlan }) => {
  const [expandedPlan, setExpandedPlan] = useState(null);

  const togglePlanDetails = (planId) => {
    setExpandedPlan(expandedPlan === planId ? null : planId);
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'Not specified';
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  if (plans.length === 0) {
    return (
      <div className="plans-list">
        <div className="card" style={{ textAlign: 'center', padding: '60px 40px' }}>
          <h2 style={{ color: '#667eea', marginBottom: '20px' }}>üìã No Travel Plans Yet</h2>
          <p style={{ fontSize: '1.1rem', color: '#666', marginBottom: '30px' }}>
            Create your first AI-powered travel plan to get started!
          </p>
          <div style={{ fontSize: '4rem', marginBottom: '20px' }}>‚úàÔ∏è</div>
          <p style={{ color: '#999' }}>
            Click on "Plan Trip" to create your first amazing travel plan with AI assistance.
          </p>
        </div>
      </div>
    );
  }

  return (
    <div className="plans-list">
      <h2 style={{ 
        textAlign: 'center', 
        color: 'white', 
        marginBottom: '30px',
        fontSize: '2rem',
        textShadow: '0 4px 8px rgba(0,0,0,0.3)'
      }}>
        üìã Your Travel Plans ({plans.length})
      </h2>

      <div className="grid">
        {plans.map(plan => (
          <div key={plan.id} className="card plan-card">
            <div className="plan-header">
              <div style={{ 
                background: 'linear-gradient(45deg, #667eea, #764ba2)', 
                color: 'white', 
                padding: '10px 15px', 
                borderRadius: '8px', 
                marginBottom: '15px',
                display: 'flex',
                justifyContent: 'space-between',
                alignItems: 'center'
              }}>
                <span style={{ fontWeight: 'bold' }}>ü§ñ AI Generated Plan</span>
                <span style={{ fontSize: '0.9rem', opacity: 0.9 }}>
                  {formatDate(plan.created_at)}
                </span>
              </div>

              <h3 style={{ color: '#2c3e50', marginBottom: '15px' }}>
                üìç {plan.ai_plan.destination.name}
              </h3>
            </div>

            <div className="plan-summary">
              <div className="summary-grid">
                <div className="summary-item">
                  <strong>üí∞ Budget:</strong>
                  <span>${plan.user_input.budget}</span>
                </div>
                <div className="summary-item">
                  <strong>üë• Travelers:</strong>
                  <span>{plan.user_input.travelers}</span>
                </div>
                <div className="summary-item">
                  <strong>üåç Destinations:</strong>
                  <span>{plan.user_input.destinations}</span>
                </div>
                <div className="summary-item">
                  <strong>üíµ Estimated Cost:</strong>
                  <span style={{ color: '#27ae60', fontWeight: 'bold' }}>
                    ${plan.ai_plan.total_estimated_cost}
                  </span>
                </div>
              </div>

              {plan.user_input.start_date && plan.user_input.end_date && (
                <div className="date-range">
                  <strong>üìÖ Travel Dates:</strong>
                  <span>{formatDate(plan.user_input.start_date)} to {formatDate(plan.user_input.end_date)}</span>
                </div>
              )}
            </div>

            <div className="plan-actions">
              <button 
                className="btn"
                onClick={() => togglePlanDetails(plan.id)}
                style={{ 
                  marginRight: '10px',
                  background: expandedPlan === plan.id 
                    ? 'linear-gradient(45deg, #28a745, #20c997)' 
                    : 'linear-gradient(45deg, #667eea, #764ba2)'
                }}
              >
